import {QuizServiceStub} from "src/app/service/QuizServiceStub";
import config from "src/app/config.json";
import { QuizService } from "./QuizService";
// import questionsDTO from "src/app/questionsRoundDTO.json";

const configPath: string = "src/app/questionsRoundDTO.json";

/**
 * Creating a new class based on QuizServiceServiceStub (if we get data locally)
 * or QuizService (if we get data from internet).
 */
export const quizService = config.IS_MODE_STUB ? new QuizServiceStub(configPath) : new QuizService(config.BASE_URL);
